  11,\n\t\"tags\": [],\n\t\"title\": \"The assessment of hull fouling as a mechanism
  for the introduction and dispersal of alien species in the main Hawaiian Islands
  through surveys at harbors on Oahu's Southern and Southwestern Coasts during 2003
  (NODC Accession 0001455)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-09-26T19:16:09.450941\",\n\t\"name\": \"the-assessment-of-hull-fouling-as-a-mechanism-for-the-introduction-and-dispersal-of-alien-speci\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Surveys for adult invertebrates that were
  part of the hull fouling communities were done to determine to what extent marine
  alien invasive species (AIS) are being transported in this fashion. The focus was
  to perform a qualitative analysis that created a species inventory. The organisms
  that generally foul vessel hulls are the typical species found in natural marine
  intertidal and subtidal fouling communities. These organisms are usually associated
  with one of the following groups: porifera (sponges), coelenterata (hydroids, corals
  and anemones), mollusca (mussels, clams, and sea slugs), annelida (marine worms),
  arthropoda (barnacles, amphipods, and crabs), bryozoa (moss animals), chordata (sea
  squirts and fish), as well as macroalgae (seaweed). Through collaboration with state
  and private industry representatives, arrivals notification for various vessel types
  was received. This arrivals information was used to schedule field survey activities
  throughout the study. Field work occurred in 2003 at harbors of southern and southwestern
  coasts of Oahu, Hawaii.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
